class BreastMRIDataset(Dataset):
    def __init__(self, patient_to_roi, radiomics_dir, ground_truth_path, augment=False):
        """
        Args:
            patient_to_roi (list of dict): List containing patient directories for T1, T2, DCE, and corresponding ROI path.
                Example: [{'patient_dir': {"T1": path_to_T1, "T2": path_to_T2, "DCE": path_to_DCE}, 'roi_path': roi_path}, ...]
            augment (bool): Whether to apply data augmentation.
        """
        self.patient_to_roi = patient_to_roi
        self.radiomics_dir = radiomics_dir
        self.augment = augment
        self.ground_truth_df = pd.read_excel(ground_truth_path) #, skiprows=1)

        # Configuration for radiomics features
        self.features_per_modality = 102  # Adjust based on your dataset
        self.num_modalities = 2  # T1, T2
        self.num_dce_timepoints = 5  # 5 time points for DCE
        self.total_features = 306 #714#(self.num_modalities + self.num_dce_timepoints) * self.features_per_modality

        self.transform = transforms.Compose([
            transforms.RandomRotation(degrees=10),
            transforms.RandomAffine(degrees=10, translate=(0.05, 0.05)),
            transforms.GaussianBlur(kernel_size=3)
        ])

    def get_patient_labels(self, patient_id):
        """
        Extract labels for lesions of a given patient.
        Assign a label of -1 if the patient has no lesions.
        """
        patient_row = self.ground_truth_df[self.ground_truth_df['Patient ID'] == patient_id]
        if patient_row.empty:
            raise ValueError(f"No ground truth found for patient: {patient_id}")

        labels = []
        for i in range(1, 7):  # Check up to 6 lesions
            col_name = f"tumor/benign{i}"
            if col_name in patient_row.columns:
                value = patient_row.iloc[0][col_name]
                if pd.notna(value):  # Skip empty values
                    labels.append(int(value))  # Convert to integer (0 or 1)

        if not labels:  # No lesions
            labels = [-1]  # Special label for no-lesion cases
        return labels


    def normalize_image_rgb(self, image):
        """
        Normalize the 3-channel image for ResNet50.
        """
        mean = np.array([0.485, 0.456, 0.406]).reshape(3, 1, 1)
        std = np.array([0.229, 0.224, 0.225]).reshape(3, 1, 1)
        return (image - mean) / std

    def normalize_image(self, image):
        """Normalize the grayscale image for ResNet50."""
        mean, std = np.mean(image), np.std(image)
        return (image - mean) / (std + 1e-8)  # Avoid division by zero


    def load_mri_images(self, directory, acquisition_prefix=None):
        """
        Loads MRI slices from a given directory.
        """
        #print(f"Loading MRI images from directory: {directory}")

        # Get all DICOM files
        dcm_files = sorted([f for f in os.listdir(directory) if f.endswith('.dcm')])
        #print(f"DICOM files found: {dcm_files}")

        # Filter by acquisition prefix if provided
        if acquisition_prefix:
            dcm_files = [f for f in dcm_files if f.startswith(acquisition_prefix)]
           # print(f"DICOM files after filtering by prefix '{acquisition_prefix}': {dcm_files}")

        if not dcm_files:  # No files found
            print(f"No DICOM files found in directory: {directory} with prefix '{acquisition_prefix}'")
            return None  # Handle gracefully

        # Load the selected DICOM files
        images = [pydicom.dcmread(os.path.join(directory, f)).pixel_array for f in dcm_files]
        return np.stack(images, axis=0)


