    def load_roi(self, roi_path, num_slices, num_lesions):
        """
        Loads ROI from a DICOM file and adjusts dimensions to match the number of slices.
        """
        if roi_path is None:
            print("Warning: ROI path is None. Returning an empty ROI.")
            # Return an empty ROI with the expected shape
            return np.zeros((num_slices, num_lesions, 512, 512), dtype=np.uint8)

        try:
            # Attempt to read the DICOM file
            roi = pydicom.dcmread(roi_path).pixel_array
        except Exception as e:
            print(f"Error reading ROI file at {roi_path}: {e}")
            # Return an empty ROI if there's an error
            return np.zeros((num_slices, num_lesions, 512, 512), dtype=np.uint8)

        # Adjust ROI dimensions if necessary
        expected_slices = num_slices * num_lesions

        if roi.shape[0] > expected_slices:  # Too many slices in ROI
            print(f"Warning: ROI has more slices than expected. Trimming to {expected_slices} slices.")
            roi = roi[:expected_slices]
        elif roi.shape[0] < expected_slices:  # Too few slices in ROI
            print(f"Warning: ROI has fewer slices than expected. Padding to {expected_slices} slices.")
            padding = np.zeros((expected_slices - roi.shape[0], *roi.shape[1:]), dtype=roi.dtype)
            roi = np.concatenate([roi, padding], axis=0)

        roi = roi.reshape((num_lesions, num_slices, 512, 512))
        roi = np.transpose(roi, (1, 0, 2, 3))  # (num_slices, num_lesions, 512, 512)
        return np.flip(roi, axis=0)  # Flip along the z-axis

    @staticmethod
    def pad_to_square(image, target_size=224): #pour l'instant je ne l'utilise pas car elle rajoute des pixels noirs tout autour pour créer un carré et j'ai peur que ca destabilise le modèle
        """
        Pads the image to make it square, preserving the aspect ratio,
        and then resizes it to the target size.
        """
        h, w = image.shape
        if h > w:
            pad = (h - w) // 2
            padded_image = np.pad(image, ((0, 0), (pad, h - w - pad)), mode='constant', constant_values=0)
        else:
            pad = (w - h) // 2
            padded_image = np.pad(image, ((pad, w - h - pad), (0, 0)), mode='constant', constant_values=0)

        # Resize the square image to the target size
        resized_image = cv2.resize(padded_image, (target_size, target_size), interpolation=cv2.INTER_NEAREST)
        return resized_image

    def preprocess_image(self, image, roi_coords, target_range=(0, 1500), crop_size=224):
        """
        Normalizes pixel values, extracts ROI, and crops around the center.
        """
        # Normalize pixel values
        image = np.clip(image, target_range[0], target_range[1])
        image = (image - target_range[0]) / (target_range[1] - target_range[0])

        # Extract ROI and crop
        x, y, w, h = roi_coords
        cropped = image[y:y+h, x:x+w]

        #cropped_resized = self.pad_to_square(cropped, target_size=crop_size)
        cropped_resized = cv2.resize(cropped, (crop_size, crop_size), interpolation=cv2.INTER_NEAREST)
        return cropped_resized


    def load_radiomics_features_original(self, patient_id, num_lesions, modalities=["T1", "T2", "DCE"]):
        
        #Load and combine radiomics features for all modalities for a given patient.
        #Handle nested directories correctly.
        
        # Extract lesion ID from patient_id (e.g., AMBL-013 -> 013)
        lesion_id = patient_id.split("-")[-1]  # Extract the numeric part
        file_path = os.path.join(self.radiomics_dir, f"combined_features_{lesion_id}.csv")
        features_per_modality = 102  # Update based on your dataset
        total_features = 714# (len(modalities) + 5) * features_per_modality  # Include 5 DCE time points


        if not os.path.exists(file_path):
            print(f"Warning: Radiomics file not found for patient: {patient_id}. Using zero features.")
            return torch.zeros((max(1, num_lesions), total_features), dtype=torch.float32)

        radiomics_df = pd.read_csv(file_path)
        if radiomics_df.empty:
            print(f"Warning: Radiomics file for patient {patient_id} is empty. Using zero features.")
            return torch.zeros((max(1, num_lesions), total_features), dtype=torch.float32)

        # Combine features for all modalities
        combined_features = []

        for modality in modalities:
            if modality == "DCE":
                for dce_timepoint in range(1, 6):
                    timepoint_df = radiomics_df[radiomics_df['modality'] == dce_timepoint]
                    timepoint_df = timepoint_df[timepoint_df['lesion'] < num_lesions]
                    feature_columns = timepoint_df.columns.difference(['modality', 'lesion'])

                    if timepoint_df.empty:
                        combined_features.append(np.zeros((num_lesions, features_per_modality)))
                    else:
                        timepoint_features = timepoint_df[feature_columns].values
                        combined_features.append(timepoint_features)
            else:
                modality_df = radiomics_df[radiomics_df['modality'] == modality]
                modality_df = modality_df[modality_df['lesion'] < num_lesions]
                feature_columns = modality_df.columns.difference(['modality', 'lesion'])

                if modality_df.empty:
                    combined_features.append(np.zeros((num_lesions, features_per_modality)))
                else:
                    modality_features = modality_df[feature_columns].values
                    combined_features.append(modality_features)

        combined_features = np.concatenate(combined_features, axis=1)  # Shape: (num_lesions, total_features)
        return torch.tensor(combined_features, dtype=torch.float32)



    def load_radiomics_features(self, patient_id, num_lesions, modalities=["DCE"], dce_phases=[1, 3, 5]):
        """
        Load and combine radiomics features for selected DCE phases (1, 3, 5) for a given patient.
        Handles nested directories correctly.
        """

        # Extract lesion ID from patient_id (e.g., AMBL-013 -> 013)
        lesion_id = patient_id.split("-")[-1]  # Extract the numeric part
        file_path = os.path.join(self.radiomics_dir, f"combined_features_{lesion_id}.csv")
        features_per_modality = 102  # Update based on your dataset
        total_features = len(dce_phases) * features_per_modality  # Only using selected DCE phases

        if not os.path.exists(file_path):
            print(f"Warning: Radiomics file not found for patient: {patient_id}. Using zero features.")
            return torch.zeros((max(1, num_lesions), total_features), dtype=torch.float32)

        radiomics_df = pd.read_csv(file_path)
        if radiomics_df.empty:
            print(f"Warning: Radiomics file for patient {patient_id} is empty. Using zero features.")
            return torch.zeros((max(1, num_lesions), total_features), dtype=torch.float32)

        # Combine features for selected DCE phases
        combined_features = []

        radiomics_df['modality'] = radiomics_df['modality'].astype(str).str.strip()  # Ensure it's a string + enleve espace s'il y en a

        for dce_timepoint in dce_phases:

            dce_timepoint_str = str(dce_timepoint)  # Convert to string for comparison
            timepoint_df = radiomics_df[radiomics_df['modality'] == dce_timepoint_str]

            timepoint_df = timepoint_df[timepoint_df['lesion'] < num_lesions]
            feature_columns = timepoint_df.columns.difference(['modality', 'lesion'])

            print(f"🔹 Filtering for DCE phase {dce_timepoint}, found {len(timepoint_df)} entries")

            if timepoint_df.empty:
                combined_features.append(np.zeros((num_lesions, features_per_modality)))
            else:
                timepoint_features = timepoint_df[feature_columns].values
                combined_features.append(timepoint_features)

        combined_features = np.concatenate(combined_features, axis=1)  # Shape: (num_lesions, total_features)
        return torch.tensor(combined_features, dtype=torch.float32)



    def __len__(self):
        return len(self.patient_to_roi)

    def __getitem__(self, idx):
        patient_data = self.patient_to_roi[idx]
        patient_dirs = patient_data['patient_dir']
        roi_path = patient_data['roi_path']

        # Extract patient ID
        patient_id = os.path.basename(os.path.dirname(os.path.dirname(patient_dirs['T1'])))

        print(f"Processing patient {patient_id}")

        # Get ground truth labels for the patient
        labels = self.get_patient_labels(patient_id)

        # Load MRI images
        t1_images = self.load_mri_images(patient_dirs["DCE"], acquisition_prefix='1-')#(patient_dirs["T1"])
        t2_images = self.load_mri_images(patient_dirs["DCE"], acquisition_prefix='3-')#(patient_dirs["T2"])
        dce_images = self.load_mri_images(patient_dirs["DCE"], acquisition_prefix='5-')

        num_slices = t1_images.shape[0]

        # Handle case with no ROI file or empty ROI
        num_lesions = 0
        if roi_path and os.path.exists(roi_path):  # ROI file exists
            roi_example = pydicom.dcmread(roi_path).pixel_array
            if np.sum(roi_example) > 0:  # ROI is not empty
                num_lesions = roi_example.shape[0] // num_slices

        # Load radiomics features for all modalities
        #radiomics_features = self.load_radiomics_features(patient_id, max(1, num_lesions),
                                                          #modalities=["T1", "T2", "DCE"])

        radiomics_features= self.load_radiomics_features(patient_id, max(1, num_lesions), modalities=["DCE"], dce_phases=[1, 3, 5] )

        three_channel_images = []

        if num_lesions == 0:  # No lesion case
            print(f"Patient {idx} has no lesions.")
            default_coords = [(142, 298, 20, 42)]  # Ensure at least one default coordinate
            middle_slice_idx = num_slices // 2  # Middle slice index

            for coords in default_coords:
                x, y, w, h = coords
                t1_slice = self.preprocess_image(t1_images[middle_slice_idx], (x, y, w, h))
                t2_slice = self.preprocess_image(t2_images[middle_slice_idx], (x, y, w, h))
                dce_slice = self.preprocess_image(dce_images[middle_slice_idx], (x, y, w, h))

                three_channel_image = torch.tensor(np.stack([t1_slice, t2_slice, dce_slice], axis=0),
                                                   dtype=torch.float32)
                three_channel_images.append(three_channel_image)

            if len(three_channel_images) == 0:
                # Ensure at least one image is returned
                print(f"No valid slices found for patient {idx}. Using zero image.")
                t1_slice = np.zeros((224, 224))  # Replace with actual dimensions
                t2_slice = np.zeros((224, 224))
                dce_slice = np.zeros((224, 224))
                three_channel_image = torch.tensor(np.stack([t1_slice, t2_slice, dce_slice], axis=0),
                                                   dtype=torch.float32)
                three_channel_images.append(three_channel_image)

            labels = torch.tensor([-1] * len(three_channel_images), dtype=torch.long)

        else:  # Process lesions normally
            roi_masks = self.load_roi(roi_path, num_slices, num_lesions)
            for lesion_idx in range(num_lesions):
                lesion_mask = roi_masks[:, lesion_idx, :, :]
                largest_slice_idx = np.argmax(np.sum(lesion_mask, axis=(1, 2)))
                roi_coords = cv2.boundingRect((lesion_mask[largest_slice_idx] > 0).astype(np.uint8))

                for offset in [-1, 0, 1]:
                    slice_idx = largest_slice_idx + offset
                    slice_idx = min(max(slice_idx, 0), num_slices - 1)  # Clamp within bounds

                    t1_slice = self.preprocess_image(t1_images[slice_idx], roi_coords)
                    t2_slice = self.preprocess_image(t2_images[slice_idx], roi_coords)
                    dce_slice = self.preprocess_image(dce_images[slice_idx], roi_coords)

                    three_channel_image = torch.tensor(np.stack([t1_slice, t2_slice, dce_slice], axis=0),
                                                       dtype=torch.float32)
                    three_channel_images.append(three_channel_image)

            # Convert labels to a tensor
            labels = torch.tensor([label for label in labels for _ in range(3)], dtype=torch.long)

            labels_2 = torch.tensor(labels[:len(three_channel_images)], dtype=torch.long)


        #print(f"Processing participant {idx}")
        print(f"Number of lesions: {num_lesions}")
        print(f"Labels: {labels}")
        print(f"Radiomics Features Shape: {radiomics_features.shape}")


        if len(three_channel_images) == 0:
            print(f"No valid images for participant {idx}")
        else:
            print(f"Returning {len(three_channel_images)} images for participant {idx}")

        # Return batch of three-channel images and radiomics features
        return torch.stack(three_channel_images, dim=0), radiomics_features, labels







